import Typography from "@material-ui/core/Typography";
import React from "react";

export const ingredientList = ["Garlic", "Basil", "Parsley", "Onion", "Salmon", "Beef Stew"];

export const recipeS1 = {
    title: "Shrimp and Chorizo Paella",
    imgPath: "https://assets.bonappetit.com/photos/57acce0453e63daf11a4da2b/16:9/w_1880,c_limit/PAELLA.jpg",
    introduction: "This impressive paella is a perfect party dish and a fun meal to cook together with your guests. Add 1 cup of frozen peas along with the mussels, if you like."
};

export const recipeList = [recipeS1, recipeS1, recipeS1];
